import React, { useEffect } from 'react';
import Particles from 'react-tsparticles';
import "../../index.css"

const ParticleComponent = () => {
    useEffect(() => {
        // No need for additional initialization logic since react-tsparticles handles it internally
    }, []);

    return (
        <div id="tsparticles">
            <Particles
                id="tsparticles"
                options={{
                    background: {
                        color: {
                            value: "#333333",
                            opacity:1
                        }
                    },
                    fullScreen:{
                        enable:true,
                        zIndex:0,
                    },
                    interactivity:{
                        detectsOn:window,
                        events:{
                            onDiv:{
                                enable:false,
                                typeof:"circle"
                            },
                            onHover:{
                                enable:false,
                                parallax:{
                                    enable:false,
                                    force:2,
                                    smooth:10
                                }
                            }
                        }
                    },
                        name:"snow",
                        detectRetina:true,
                        duration:0,
                        fpsLimit:120,
                        motion:{
                            enable:true,
                        },
                    particles: {
                        bounce:{
                            horizontal:{
                                value:1
                            },
                            vertical:{
                                value:1
                            }
                        },
                        color: {
                            value: "#ffffff"
                        },
                        number: {
                            value: 100
                        },
                        size: {
                            value: 3
                        },
                        move: {
                            speed: 2
                        }
                    }
                }}
            />
        </div>
    );
};

export default ParticleComponent;
